import "./App.css";
import Map from "./Map";
import placeholder from "./place-holder.jpg";

function App() {
  return (
    <div className="container">
      <div className="image-panel">
        <h1>Guess the murual is at. </h1>
        <p>
          {" "}
          On the map, place the pin on where you think the murual is located at.
          Then hit submit button.
        </p>
        <img src={placeholder} alt="placeholder" />
      </div>
      <div className="map-container">
        <Map />
      </div>
    </div>
  );
}

export default App;
